import React from 'react'
import { Button, DialogTitle, Dialog, TextField } from "@material-ui/core";
import { useState } from "react"
import { Form } from 'react-bootstrap';
import { DialogContent } from '@material-ui/core';
import { Grid } from '@material-ui/core';

function EditUser({user}){

  const [firstName, setFirstName] = useState([]);
  const [lastName, setLastName] = useState([]);
  const [email, setEmail] = useState([]);
  const [username, setUsername] = useState([]);
  const [open, setOpen] = React.useState(false);
  const handleClickToOpen = () => {
    setOpen(true);
  };

  const handleToClose = () => {
    setOpen(false);
  };


  function handleSubmit(){
    console.log("submitted")
  }

  console.log(user)

  return(
    <>
        <Button variant="outlined" color="primary" onClick={handleClickToOpen}>
          Signup
        </Button>
        <Dialog open={open} onClose={handleToClose} onSubmit={handleSubmit} >
        <DialogTitle>{"Sign Up"}</DialogTitle>
        <DialogContent>
        <Form>
        <Grid>
          <TextField 
          required
          variant="outlined"
          id="outline-required"
          label="Required"
          name='first_name'
          defaultValue={user?.first_name}
          onChange={e=>setFirstName(e.target.value)}
        ></TextField>
        </Grid>
            <Grid>
              <TextField 
          required
          variant="outlined"
          id="outline-required"
          label="Required"
          name='last_name'
          defaultValue={user?.last_name}
          onChange={e=>setLastName(e.target.value)}
        ></TextField>
        </Grid>
            <Grid>
              <TextField 
          required
          variant="outlined"
          id="outline-required"
          label="Required"
          name='username'
          defaultValue={user?.username}
          onChange={e=>setUsername(e.target.value)}
        ></TextField>
        </Grid>
            <Grid>
              <TextField 
          required
          variant="outlined"
          id="outline-required"
          label="Required"
          name='email'
          defaultValue={user?.email}
          onChange={e=>setEmail(e.target.value)}
        ></TextField>
        </Grid>
        </Form>
        </DialogContent>
        <Button onClick={handleToClose} font-color="red" autoFocus>
          Close
        </Button>
      </Dialog>
      </>
    )
}
export default EditUser
